import ExpenseItem from "./Components/ExpenseItem";


function App(){

    let expenseDate = new Date(2020,11,11);
    let expenseTitle = "School Fees";
    let expenseAmount = "$555";

    return  (
        <div>
           <ExpenseItem
            date =  "22-11-11" 
            title = " "
            amount = {expenseAmount}>
            </ExpenseItem>
        </div>
    );
}


export default App;
